import { axiosPrivate } from "../../utils/useAxios";
import { ACCESS_TOKEN_USER } from "../types";

export const getUsers = (data) => (dispatch) => {
  try {
    console.log("3. Get Contact Berhasil :", req);
    dispatch({
      type: ACCESS_TOKEN_USER,
      payload: req.data,
    });
    return Promise.resolve(req);
  } catch (error) {
    console.log(error);
  }
};
